import { Link} from "react-router-dom";
import React from "react";
import { Navbar, Nav } from 'rsuite';

const CustomNavbar = ({ onSelect, activeKey, ...props }) => {
  return (
    <Navbar {...props}>
      <Navbar.Brand href="#">RSUITE</Navbar.Brand>
      <Nav onSelect={onSelect} activeKey={activeKey}>
        <Nav.Item eventKey="1" icon={<HomeIcon />}>
          Home
        </Nav.Item>
        <Nav.Item eventKey="2"><Link className="header-items" to="/">Home</Link></Nav.Item>
        <Nav.Item eventKey="3"><Link className="header-items" to="/movie">Movie</Link></Nav.Item>
        <Nav.Item eventKey="7"><Link className="header-items" to="/popular">Popular</Link></Nav.Item>
        <Nav.Item eventKey="8"><Link className="header-items" to="/top_anime">Top Anime</Link></Nav.Item>
        <Nav.Menu title="About">
          <Nav.Item eventKey="4">Company</Nav.Item>
          <Nav.Item eventKey="5">Team</Nav.Item>
          <Nav.Item eventKey="6">Contact</Nav.Item>
        </Nav.Menu>
      </Nav>
      <Nav pullRight>
        <Nav.Item icon={<CogIcon />}>Settings</Nav.Item>
      </Nav>
    </Navbar>
  );
};


function MY_Navbar() {
  const [activeKey, setActiveKey] = React.useState(null);
  return (

    <CustomNavbar appearance="subtle" activeKey={activeKey} onSelect={setActiveKey} />
    // <div className="header-links">
    //   <Link className="header-items" to="/">Home</Link>
    //   <Link className="header-items" to="/movie">Movie</Link>
    //   <Link className="header-items" to="/popular">Popular</Link>
    //   <Link className="header-items" to="/top_anime">Top Anime</Link>
    // </div>
  );
}
export default MY_Navbar;







